(17, 8, 'CS50', 'Yale', '2015-12-11 15:27:06', 'March Of Resilience', 'event', 'On November 9, 2015: "NEW HAVEN, Conn. (WTNH)Thousands of students at Yale University gathered on Monday to call for an end to racism on campus. They came together in what was called the March of Resilience, meant to bring the community and students of all backgrounds together.  Chants were audible throughout the campus Monday afternoon, as hundreds yelled, We out here. We been here. We aint leaving. We are loved.  The march started at the African American Cultural Center on Park Street. They went by the other cultural centers, past the fraternities, and ended in the center of campus."', NULL, 'http://i.imgur.com/alJ9lF7.jpg', NULL),
(18, 8, 'CS50', 'Yale', '2015-12-11 15:30:24', 'Freedom and Identity of Black Culture', 'class', 'Even though it was his last semester at Yale, people need to still find and read that syllabus!!!', 'Jafari Allen', NULL, NULL),
(19, 8, 'CS50', 'Yale', '2015-12-11 16:11:41', 'Citizen', 'book', 'An amazing read!', 'Claudia Reinkin', NULL, NULL);
